import React from "react";
import { authService } from "../firebase";

const Profile = ()=>{
  const onLogoutClick = ()=> authService.signOut();
  return(
    <>
    <button onClick={onLogoutClick}>LogOut</button>
    </>
  )

}
{/* <h2>Profile Page</h2> */}

export default Profile;
